import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open Product Detail Modal by clicking on the first product card
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');

    // Take screenshot after opening the modal
    await page.waitForSelector('.product-detail-info', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_detail_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_detail_modal.png'));

    // Extract product title and price for verification
    const productTitle = await page.textContent('.product-detail-title');
    const productPrice = await page.textContent('.product-detail-price');

    return {
      success: true,
      action: "Opened the product detail modal and extracted product information",
      extractedData: {
        title: productTitle,
        price: productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
